import { observable, action, decorate } from "mobx"; 

class SearchsStore { 

  feeds = []; 
  feed = ""; 

  setFeeds(feeds) { 
    this.feeds = feeds; 
  } 

  setSelectedSearch(feed) { 
    this.feed = feed; 
  } 
} 

SearchsStore = decorate(SearchsStore, { 
  feeds: observable, 
  feed: observable, 
  setFeeds: action, 
  setSelectedFeed: action, 
}); 

export { SearchsStore };
